.format-btn-container {
  display: flex;
  justify-content: flex-end;
  padding: 12px 0 16px 0;
  background: transparent;
  align-items: center;
}
.format-btn-container button {
  padding: 6px 20px;
  font-size: 15px;
  font-weight: 500;
  font-family: "Segoe UI", Arial, sans-serif;
  border: 1px solid #bdbdbd;
  border-right: none;
  background: #fff;
  color: #2986F5;
  cursor: pointer;
  outline: none;
  margin: 0;
  min-width: 70px;
  border-radius: 0;
  box-shadow: none;
  transition: background 0.12s, color 0.12s, border 0.12s;
}
.format-btn-container button:first-child {
  border-radius: 16px 0 0 16px;
}
.format-btn-container button:last-child {
  border-radius: 0 16px 16px 0;
  border-right: 1px solid #bdbdbd;
}
.format-btn-container button.active {
  background: #2986F5;
  color: #fff;
  border: 1px solid #2986F5;
  border-right: none;
  z-index: 1;
}
.format-btn-container button.active:last-child {
  border-right: 1px solid #2986F5;
}
.format-btn-container button:not(.active):hover {
  background: #e8f1fc;
  color: #1976d2;
  border-color: #90caf9;
}
.format-btn-container button:disabled {
  opacity: 0.5;
  cursor: not-allowed;
  background: #f7f7f7;
  color: #a8a8a8;
  border-color: #e0e0e0;
}
.parent-btn-container {
  display: flex;
  justify-content: flex-start;
  padding: 12px 0 16px 0;
  background: transparent;
  align-items: center;
}
.parent-btn-container button {
