  border-right: none;
  background: #fff;
  color: #2986F5;
  cursor: pointer;
  outline: none;
  margin: 0;
  min-width: 70px;
  border-radius: 0;
  box-shadow: none;
  transition: background 0.12s, color 0.12s, border 0.12s;
}
.parent-btn-container button:first-child {
