.parent-toggle-btn {
  background: none;
  border: none;
  color: #2986F5;
  font-weight: bold;
  font-size: 16px;
  cursor: pointer;
  padding: 2px 8px;
  margin-right: 6px;
  border-radius: 6px;
  transition: background 0.12s;
}
.parent-toggle-btn:focus {
  outline: 1.5px solid #2986F5;
}
.parent-toggle-btn:hover {
  background: #e8f1fc;
}
.parent-toggle-btn {
  padding: 4px 12px;
  border: 1px solid #c0c0c0;
  border-radius: 4px;
  background: #fff;
  font-size: 14px;
  cursor: pointer;
  margin-left: 4px;
  transition: background 0.1s, color 0.1s;
}
.parent-toggle-btn.active {
  background: #0d6efd;
  color: #fff;
  border-color: #0d6efd;
}
.x-axis-fixed {
  pointer-events: none;
}
